import React, { useState, useEffect } from "react";

import { updateParameter } from "../src/helpers/update";
import {
  MakeCar,
  ModelMake,
  VersionModel,
  Vehicles,
} from "../src/services/requests";
function Page({ GetMakeCar, filtrar, query }) {
  return (
    <>
      <form>
        <input></input>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          {GetMakeCar.map((make) => {
            return <option>{make.Name}</option>;
          })}
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
        <select className="input" name="grade_group">
          <option></option>
        </select>
      </form>
    </>
  );
}

Page.getInitialProps = async ({ query }) => {
  let filtrar = [];

  const GetMakeCar = await MakeCar();
  const GetModelMake = await ModelMake();
  const GetVersionModel = await VersionModel();
  const GetVehicles = await Vehicles();
  return {
    filtrar,
    query,
    GetMakeCar,
  };
};

export default Page;
